    "content": "<ComponentPreview name=\"accordion-demo\" />\r\n\r\n## Installation\r\n\r\nFollow these simple steps to add the Accordion component to your project:\r\n\r\n<Steps>\r\n\r\n<Step>\r\nInstall Dependencies\r\n</Step>\r\n\r\n```bash\r\nnpm install motion\r\n```\r\n\r\n<Step>\r\n    Create a new file: `components/motions/accordion.tsx` and copy the code below:\r\n</Step>\r\n\r\n<CollapsibleSource name=\"accordion\" />\r\n\r\n<Step>\r\n    Adjust the import paths in both files according to your project's structure.\r\n</Step>\r\n\r\n</Steps>\r\n\r\n## Examples\r\n\r\n### W/ chevron\r\n\r\n<ComponentPreview name=\"accordion-sign\" />\r\n\r\n### W/ plus-minus & icon\r\n\r\n<ComponentPreview name=\"accordion-icon\" />\r\n\r\n{/* ### W/ icon and chevron */}",
