    "content": "## Quick Installation Guide\r\n\r\n<Steps>\r\n<Step>Create a Next.js Project</Step>\r\n\r\nCreate a new Next.js project with TypeScript and Tailwind CSS:\r\n\r\n```bash\r\nnpx create-next-app@latest\r\n```\r\n\r\n```plaintext\r\n✔ What is your project named? ... my-app\r\n✔ Would you like to use TypeScript? ... Yes\r\n✔ Would you like to use ESLint? ... Yes\r\n✔ Would you like to use Tailwind CSS? ... Yes\r\n✔ Would you like to use `src/` directory? ... No\r\n✔ Would you like to use App Router? ... Yes\r\n✔ Would you like to customize the default import alias? ... Yes\r\n✔ What import alias would you like configured? ... @/*\r\n```\r\n\r\n\r\n<Step>Download Components</Step>\r\n\r\nYou can get all the components from our GitHub repository:\r\n\r\n```bash\r\ngit clone https://github.com/cnippet-site/all-elements\r\n```\r\n\r\nOr download them directly from our [GitHub repository](https://github.com/cnippet-site/all-elements/). The repository includes all components, examples, and additional utilities.\r\n\r\n<Step>Add the utility helper</Step>\r\n\r\nCreate a `lib/utils.ts` file to manage Tailwind CSS classes. This utility helps combine Tailwind classes efficiently and handles class name conflicts:\r\n\r\n```bash\r\nnpm install clsx tailwind-merge\r\n```\r\n\r\n```tsx\r\nimport { clsx, type ClassValue } from \"clsx\";\r\nimport { twMerge } from \"tailwind-merge\";\r\n\r\nexport function cn(...inputs: ClassValue[]) {\r\n    return twMerge(clsx(inputs));\r\n}\r\n```\r\n\r\n\r\n\r\n<Step>Update globals.css file</Step>\r\n\r\nAdd the following code to your globals.css file:\r\n\r\n```css\r\n@import \"tailwindcss\";\r\n\r\n:root {\r\n  --background: oklch(1 0 0);\r\n  --foreground: oklch(0.145 0 0);\r\n  --card: oklch(1 0 0);\r\n  --card-foreground: oklch(0.145 0 0);\r\n  --popover: oklch(1 0 0);\r\n  --popover-foreground: oklch(0.145 0 0);\r\n  --primary: oklch(0.205 0 0);\r\n  --primary-foreground: oklch(0.985 0 0);\r\n  --secondary: oklch(0.97 0 0);\r\n  --secondary-foreground: oklch(0.205 0 0);\r\n  --muted: oklch(0.97 0 0);\r\n  --muted-foreground: oklch(0.556 0 0);\r\n  --accent: oklch(0.97 0 0);\r\n  --accent-foreground: oklch(0.205 0 0);\r\n  --destructive: oklch(0.577 0.245 27.325);\r\n  --destructive-foreground: oklch(0.577 0.245 27.325);\r\n  --border: oklch(0.922 0 0);\r\n  --input: oklch(0.922 0 0);\r\n  --ring: oklch(0.708 0 0);\r\n  --chart-1: 221.2 83.2% 53.3%;\r\n  --chart-2: 212 95% 68%;\r\n  --chart-3: 216 92% 60%;\r\n  --chart-4: 210 98% 78%;\r\n  --chart-5: 212 97% 87%;\r\n}\r\n\r\n.dark {\r\n  --background: oklch(0.145 0 0);\r\n  --foreground: oklch(0.985 0 0);\r\n  --card: oklch(0.145 0 0);\r\n  --card-foreground: oklch(0.985 0 0);\r\n  --popover: oklch(0.145 0 0);\r\n  --popover-foreground: oklch(0.985 0 0);\r\n  --primary: oklch(0.985 0 0);\r\n  --primary-foreground: oklch(0.205 0 0);\r\n  --secondary: oklch(0.269 0 0);\r\n  --secondary-foreground: oklch(0.985 0 0);\r\n  --muted: oklch(0.269 0 0);\r\n  --muted-foreground: oklch(0.708 0 0);\r\n  --accent: oklch(0.269 0 0);\r\n  --accent-foreground: oklch(0.985 0 0);\r\n  --destructive: oklch(0.396 0.141 25.723);\r\n  --destructive-foreground: oklch(0.637 0.237 25.331);\r\n  --border: oklch(0.269 0 0);\r\n  --input: oklch(0.269 0 0);\r\n  --ring: oklch(0.556 0 0);\r\n  --chart-1: 221.2 83.2% 53.3%;\r\n  --chart-2: 212 95% 68%;\r\n  --chart-3: 216 92% 60%;\r\n  --chart-4: 210 98% 78%;\r\n  --chart-5: 212 97% 87%;\r\n}\r\n\r\n@theme inline {\r\n  --color-background: var(--background);\r\n  --color-foreground: var(--foreground);\r\n  --color-card: var(--card);\r\n  --color-card-foreground: var(--card-foreground);\r\n  --color-popover: var(--popover);\r\n  --color-popover-foreground: var(--popover-foreground);\r\n  --color-primary: var(--primary);\r\n  --color-primary-foreground: var(--primary-foreground);\r\n  --color-secondary: var(--secondary);\r\n  --color-secondary-foreground: var(--secondary-foreground);\r\n  --color-muted: var(--muted);\r\n  --color-muted-foreground: var(--muted-foreground);\r\n  --color-accent: var(--accent);\r\n  --color-accent-foreground: var(--accent-foreground);\r\n  --color-destructive: var(--destructive);\r\n  --color-destructive-foreground: var(--destructive-foreground);\r\n  --color-border: var(--border);\r\n  --color-input: var(--input);\r\n  --color-ring: var(--ring);\r\n  --color-chart-1: var(--chart-1);\r\n  --color-chart-2: var(--chart-2);\r\n  --color-chart-3: var(--chart-3);\r\n  --color-chart-4: var(--chart-4);\r\n  --color-chart-5: var(--chart-5);\r\n}\r\n\r\n/*\r\n  The default border color has changed to `currentColor` in Tailwind CSS v4,\r\n  so we've added these compatibility styles to make sure everything still\r\n  looks the same as it did with Tailwind CSS v3.\r\n\r\n  If we ever want to remove these styles, we need to add an explicit border\r\n  color utility to any element that depends on these defaults.\r\n*/\r\n@layer base {\r\n  *,\r\n  ::after,\r\n  ::before,\r\n  ::backdrop,\r\n  ::file-selector-button {\r\n    border-color: var(--color-gray-200, currentColor);\r\n  }\r\n}\r\n```\r\n\r\n<Step>That's it🎉</Step>\r\n\r\nYou can now start adding components to your project. Each component can be imported from the components directory:\r\n\r\n```tsx\r\nimport { Button } from \"@/components/ui/button\";\r\n```\r\n\r\nYou can also choose manual installation and copy the code directly from each component's page in our documentation.\r\n\r\n{/* For any issues or questions, please visit our [GitHub repository](https://github.com/cnippet/ui-cnippet/issues) or join our community discussions. */}\r\n\r\n</Steps>",
